    , `NroCuponDVEN`
    , `NroFacturaDVEN`
    , `IdEmpleadoDVEN`
    , `LiquidadoDVEN`
    , `EsperaDVEN`
    , `DevolucionDVEN`
    FROM ventas_detalle_export_cons 
    WHERE `FechaVEN` >= CURDATE() AND FechaVEN < CURDATE() + 1
